import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        info: ''
     }
     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response)
              this.setState({
                 info: response.data
             })
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 

        let { info } = this.state
        const some = info[0]
        console.log(some.name)
        return ( 
            <div>
                {
                <p>Ayat House: { info.name}</p> 
                }
            </div>
         );
    }
}

export default Main;
